A. y=\frac{\mathrm{e}^{x}-x^{2}}{x^{2}+1} 的定义域为 R, 且 f(-x)=\frac{\mathrm{e}^{-x}-(-x)^{2}}{(-x)^{2}+1}=\frac{\mathrm{e}^{-x}-x^{2}}{x^{2}+1} ≠ f(x), 故 A 错误;
B. y=\frac{\cos x+x^{2}}{x^{2}+1} 的定义域为 R, 且 f(-x)=\frac{\cos(-x)+(-x)^{2}}{(-x)^{2}+1}=\frac{\cos x+x^{2}}{x^{2}+1}=f(x), 故 B 正确;
C. y=\frac{\mathrm{e}^{x}-x}{x+1} 的定义域为 {x|x ≠-1},不关于原点对称,故 C 错误;
D. y=\frac{\sin x+4 x}{\mathrm{e}^{|x|}} 的定义域为 R, 且 f(-x)=\frac{\sin(-x)+4(-x)}{\mathrm{e}^{|-x|}}=\frac{-\sin x-4 x}{\mathrm{e}^{|x|}}=-f(x), 故 D 错误.
最终得B.

