question:
某农业研究部门在面积相等的 100 块稻田上种植一种新型水稻, 得到各块稻田的亩产量（单位： kg ）并整理如下表
\begin{table}[]
\begin{tabular}{|c|c|c|l|l|l|l|}
\hline
亩产量 & [900,950) & [950,1000) & [1000,1050) & [1050,1100) & [1100,1150) & [1150,1200) \ \hline
频数  & 6           & 12           & 18            & 30            & 24            & 10            \ \hline
\end{tabular}
\end{table}
根据表中数据，下列结论中正确的是（） A. 100 块稻田亩产量的中位数小于 1050 kg B. 100 块稻田中亩产量低于 1100 kg 的稻田所占比例超过 80 \% C. 100 块稻田亩产量的极差介于 200 kg 至 300kg 之间 D. 100 块稻田亩产量的平均值介于 900 kg 至 1000 kg 之间

